import React from 'react';
import PropTypes from 'prop-types';
import "./StyleHeader.css"
import FormHeader from './FormHeader';
import { useState } from 'react';


const Header = props => {
    const [tus , settus] =  useState("none");
    function btn(){
        if(tus== ""){
          settus("style={{display : none}}")  
        }else if (tus=="style={{display : none}}"){
        settus("")
        }
    }
    return (
        <div style={{display : "none"}}  className='header w-100 bg-primary justify-content-between'>
            <FormHeader/>
            <div className="home">
                <button onClick={btn} type="button">Home</button>
            </div>
            <div className="search">
                <input type="search" placeholder='Search' />        
                <button>Search</button>
            </div>
        </div>
    );
};

Header.propTypes = {
    
};

export default Header;
